import Hero from './images/hero.jpg'

const Landing = () => {
    return (
        <div className='container mx-auto flex h-screen filter contrast-125 brightness-90 blur-sm scale-125'>
            <div className='w-full h-full relative'>
                <img className='w-full h-full object-cover absolute' src={Hero}  alt=''/>
